const Nav = ({h1}) => {
    return (
        <nav>
            <div id="hamburger_menu nav_hover"><i class="fas fa-bars"></i></div>
            <div className="logo nav_hover"></div>
            <h1>{h1}</h1>
        </nav>
    )
}

export default Nav;
